INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 2, 24, 401, 0.0, 0.0, 2, "アヤネ", "2030/12/17 14:59:59", 0.0, 102301, 24001, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 402, 0.0, 0.0, 2, "アヤネ", "2030/12/17 14:59:59", 2.21, 102301, 24002, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 2, 24, 403, 0.0, 0.0, 2, "アヤネ", "2030/12/17 14:59:59", 0.0, 102301, 24003, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 2, 24, 701, 0.0, 0.0, 1, "アサヒ", "2030/12/17 14:59:59", 1.99, 192201, 24004, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 702, 0.0, 0.0, 2, "アサヒ", "2030/12/17 14:59:59", 2.21, 192201, 24005, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 2, 24, 703, 0.0, 0.0, 1, "アサヒ", "2030/12/17 14:59:59", 3.33, 192201, 24006, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 2, 24, 801, 0.0, 0.0, 2, "部員３", "2030/12/17 14:59:59", 0.0, 192301, 24007, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 802, 0.0, 0.0, 2, "部員３", "2030/12/17 14:59:59", 2.68, 192301, 24008, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 2, 24, 803, 0.0, 0.0, 2, "部員３", "2030/12/17 14:59:59", 0.0, 192301, 24009, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 501, 0.0, 0.0, 1, "", "2030/12/17 14:59:59", 0.0, 192501, 24010, "やった！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 502, 0.0, 0.0, 1, "", "2030/12/17 14:59:59", 0.0, 192501, 24011, "勝ったよ！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 503, 0.0, 0.0, 1, "", "2030/12/17 14:59:59", 0.0, 192501, 24012, "いい調子！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 6, 24, 111, 0.0, 0.0, 2, "ミサト", "2030/12/17 14:59:59", 5.33, 113501, 24013, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 112, 0.0, 0.0, 2, "ミサト", "2030/12/17 14:59:59", 6.85, 113501, 24014, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 113, 0.0, 0.0, 2, "ミサト", "2030/12/17 14:59:59", 3.0, 113501, 24015, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 611, 0.0, 0.0, 2, "ダイチ", "2030/12/17 14:59:59", 6.11, 192401, 24016, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 612, 0.0, 0.0, 2, "ダイチ", "2030/12/17 14:59:59", 6.75, 192401, 24017, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 2, 24, 613, 0.0, 0.0, 2, "ダイチ", "2030/12/17 14:59:59", 0.0, 192401, 24018, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 2, 24, 211, 0.0, 0.0, 1, "ハツネ", "2030/12/17 14:59:59", 4.52, 113401, 24019, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 2, 24, 212, 0.0, 0.0, 1, "ハツネ", "2030/12/17 14:59:59", 3.89, 113401, 24020, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 213, 0.0, 0.0, 2, "ハツネ", "2030/12/17 14:59:59", 13.49, 113401, 24021, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 311, 0.0, 0.0, 2, "カヤ", "2030/12/17 14:59:59", 3.17, 106501, 24022, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 312, 0.0, 0.0, 2, "カヤ", "2030/12/17 14:59:59", 4.42, 106501, 24023, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 6, 24, 313, 0.0, 0.0, 1, "カヤ", "2030/12/17 14:59:59", 2.89, 106501, 24024, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 4, 24, 421, 0.0, 0.0, 3, "アヤネ", "2030/12/17 14:59:59", 3.71, 102301, 24025, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 2, 24, 721, 0.0, 0.0, 1, "アサヒ", "2030/12/17 14:59:59", 5.1, 192201, 24026, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 821, 0.0, 0.0, 3, "部員３", "2030/12/17 14:59:59", 4.34, 192301, 24027, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 521, 0.0, 0.0, 1, "", "2030/12/17 14:59:59", 0.0, 192501, 24028, "いい勝負だったよ\nまたやろうね", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 101, 0.0, -360.0, 2, "ミサト", "2030/12/17 14:59:59", 5.62, 113501, 24029, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 102, 0.0, -360.0, 2, "ミサト", "2030/12/17 14:59:59", 9.58, 113501, 24030, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 2, 24, 103, 0.0, -360.0, 2, "ミサト", "2030/12/17 14:59:59", 0.0, 113501, 24031, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 2, 24, 104, 0.0, -360.0, 1, "ミサト", "2030/12/17 14:59:59", 9.13, 113501, 24032, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 10046);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("2020/07/31 12:00:00", 1, 24, 105, 0.0, -360.0, 2, "ミサト", "2030/12/17 14:59:59", 8.27, 113501, 24033, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 10046);
